import { useState } from 'react'
import { useNavigate } from 'react-router-dom';

function Signup() {
  const navigate = useNavigate();
  const [name, setName] = useState('');
  const [email, setEmail] = useState('');
  const [phone, setPhone] = useState('');
  const [gender, setGender] = useState('');
  const [heardFrom, setHeardFrom] = useState([]);
  const [city, setCity] = useState('');
  const [state, setState] = useState('');

  async function registerUser(event) {
      event.preventDefault();

      const response = await fetch('http://localhost:5000/api/register', {
          method: 'POST',
          headers: {
              'Content-Type': 'application/json',
          },
          body: JSON.stringify({
              name,
              email,
              phone,
              gender,
              heardFrom,
              city,
              state,
          }),
      });

      const data = await response.json();

      if (data.status === 'ok') {
          navigate('/login');
      }
  }

  return (
      <div className="p-4">
          <h1 className="text-2xl font-bold mb-4">Register</h1>
          <form onSubmit={registerUser} className="space-y-4">
              <input
                value={name}
                onChange={(e) => setName(e.target.value)}
                type="text"
                placeholder="Name"
                className="w-full p-2 border rounded"
              />
              <input
                value={email}
                onChange={(e) => setEmail(e.target.value)}
                type="email"
                placeholder="Email"
                className="w-full p-2 border rounded"
              />
              <input
                value={phone}
                onChange={(e) => setPhone(e.target.value)}
                type="tel"
                placeholder="Phone"
                className="w-full p-2 border rounded"
              />
              <div>
                 <label><input type="radio" value="Male" checked={gender === 'Male'} onChange={(e) => setGender(e.target.value)} /> Male</label>
                 <label><input type="radio" value="Female" checked={gender === 'Female'} onChange={(e) => setGender(e.target.value)} /> Female</label>
                 <label><input type="radio" value="Others" checked={gender === 'Others'} onChange={(e) => setGender(e.target.value)} /> Others</label>
              </div>
              <div>
                 <label><input type="checkbox" value="LinkedIn" checked={heardFrom.includes('LinkedIn')} onChange={(e) => setHeardFrom([...heardFrom, e.target.value])} /> LinkedIn</label>
                 <label><input type="checkbox" value="Friends" checked={heardFrom.includes('Friends')} onChange={(e) => setHeardFrom([...heardFrom, e.target.value])} /> Friends</label>
                 <label><input type="checkbox" value="Job Portal" checked={heardFrom.includes('Job Portal')} onChange={(e) => setHeardFrom([...heardFrom, e.target.value])} /> Job Portal</label>
                 <label><input type="checkbox" value="Others" checked={heardFrom.includes('Others')} onChange={(e) => setHeardFrom([...heardFrom, e.target.value])} /> Others</label>
              </div>
              <select
                value={city}
                onChange={(e) => setCity(e.target.value)}
                className="w-full p-2 border rounded"
              >
                 <option value="">Select City</option>
                 <option value="Mumbai">Mumbai</option>
                 <option value="Pune">Pune</option>
                 <option value="Ahmedabad">Ahmedabad</option>
              </select>
              <input
                value={state}
                onChange={(e) => setState(e.target.value)}
                type="text"
                placeholder="State"
                className="w-full p-2 border rounded"
              />
              <input type="submit" value="Register" className="w-full p-2 bg-blue-500 text-white rounded cursor-pointer" />
          </form>
      </div>
  );
}

export default Signup;
